import { configureStore } from '@reduxjs/toolkit'
import signupSlice from './ReduxSlices/signup-slice'
import loginSlice from './ReduxSlices/login-slice'

export const store = configureStore({
  reducer: {
    signup: signupSlice, 
    login:loginSlice, 
    condition
  },
})
